import { createCommand } from './index';
export const openPixelEditor = () => {
  return createCommand({
    type: 'openPixelEditor'
  });
};
export const closePixelEditor = () => {
  return createCommand({
    type: 'closePixelEditor'
  });
};
export const closePixelEditorAndSave = saveTransform => {
  return createCommand({
    type: 'closePixelEditor'
  }, saveTransform);
};